$(document).ready(function(){
	$('.phone').mask('(99) 99999-9999');
  $('input, textarea').placeholder();
  $('.scroll').click(function(event) {
    event.preventDefault();
    var $anchor = $(this);
    $.smoothScroll({
	    speed: 900,
	    offset: $($anchor.attr('href')).offset().top + 20
    });
  });
});


