function valida() {
  var msg = "";
  if($("#name").val()=="") {
    msg+= "Por favor informe seu nome.\n";
  }
  if($("#email").val()=="") {
    msg+= "Por favor informe seu e-mail.\n";
  }
  if($("#phone").val()=="" || $("#phone").val()=="(__) _____-____" || $("#phone").val().length<=12) {
    msg+= "Por favor informe seu telefone.\n";
  }
  if(msg!="") {
	  sweetAlert({
			title: "Erro!", 
	    text: msg, 
	    type: "error"
		});
    return false;
  } else {
    return true;
  }
}

